import React from 'react';
import Side from './sidebar';
function Favourites(){
    return(
        <div fluid className="dashboard">
        <div>
        <Side/>
        </div>
        <div className="content">
            <div className="Fav">
                <h1>Favourites
                    </h1>
                </div>
        </div>
        </div>
    )
}
export default Favourites;
